prompts.prompt:
Integrate the following JavaScript function into an existing JavaScript file and ensure it works with a corresponding HTML file.

JavaScript function to integrate:
function contarVocales(frase) {
    let contador = { a: 0, e: 0, i: 0, o: 0, u: 0 };
    frase.toLowerCase().split('').forEach(char => {
        if (contador.hasOwnProperty(char)) {
            contador[char]++;
        }
    });
    return contador;
}

